import React from "react";

function Score() {
  return (
    <div>
      <h1>SCORE</h1>
      <ul>
        <li>1. John - 3</li>
        <li>2. Lily - 4</li>
        <li>3. Jan - 6</li>
        <li>4. San - 9</li>
        <li>5. Shi - 10</li>
        <li>6. Su - 12</li>
        <li>7 Li - 16</li>
        <li>8. Will - 17</li>
        <li>9. Adam - 20</li>
      </ul>
    </div>
  );
}
export default Score;
